import React from 'react';
import './App.css';
import IndexMenu from './componentes/Index/IndexMenu.jsx';
import SecondMenu from './componentes/SecondTierPages/SecondTierMenu.jsx';
import ThirdMenu from './componentes/ThirdTierPages/ThirdTierMenu.jsx';
import FourthMenu from './componentes/FourthTierPages/FourthTierMenu.jsx';
import Index from './componentes/Index/Index.jsx'
import suzuki from './componentes/PaginaInicial/Suzuki.jsx';
import hamaya from './componentes/PaginaInicial/Hamaya.jsx';
import honda from './componentes/SecondTierPages/Honda.jsx';
// import honda from './componentes/PaginaInicial/Honda.jsx';
import lambreta from './componentes/PaginaInicial/Lambreta.jsx';
import Harley from './componentes/PaginaInicial/Harley.jsx';
// import Harley from './componentes/SecondTierPages/Harley.jsx';
import City from './componentes/SecondTierPages/City.jsx';
import Sport from './componentes/SecondTierPages/Sport.jsx';
// import AFazenda from './componentes/SecondTierPages/AFazenda.jsx';
import Scooter from './componentes/SecondTierPages/Scooter.jsx';
// import RaulGil from './componentes/SecondTierPages/RaulGil.jsx';
import OffRoad from './componentes/SecondTierPages/OffRoad.jsx';
// import CidadeAlerta from './componentes/SecondTierPages/CidadeAlerta.jsx';
import Trail from './componentes/ThirdTierPages/Trail.jsx';
// import BalancoGeral from './componentes/ThirdTierPages/BalancoGeral.jsx';
import Biz from './componentes/ThirdTierPages/Biz.jsx';
import Cgfan from './componentes/ThirdTierPages/Cgfan.jsx';
import CgTitam from './componentes/ThirdTierPages/Cgtitan.jsx';
import Pop from './componentes/FourthTierPages/Pop.jsx';
import Painel from './componentes/FourthTierPages/Painel.jsx';
import Freios from './componentes/FourthTierPages/Freios.jsx';
import Tanque from './componentes/FourthTierPages/Tanque.jsx';
import CgTitam2 from './componentes/FourthTierPages/Rodas.jsx';
import Carenagem from './componentes/FourthTierPages/Carenagem.jsx';
import { HashRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <div>
       <Router>
         <Switch>
           <Route exact path="/">
                <IndexMenu/>
                <Index/>
           </Route>
           <Route exact path="/suzuki">
                <IndexMenu/>
                <suzuki/>
           </Route>
           <Route exact path="/hamaya">
                <IndexMenu/>
                <hamaya/>
           </Route>
           <Route exact path="/honda">
           <SecondMenu/>
                <honda/>
           </Route>
           <Route exact path="/lambreta">
                <IndexMenu/>
                <lambreta/>
           </Route>
           <Route exact path="/harley">
           <IndexMenu/>
                <harley/>
           </Route>
           <Route exact path="/honda/City">
           <ThirdMenu/>
                <City/>
           </Route>
           <Route exact path="/honda/Sport">
                <SecondMenu/>
                <Sport/>
           </Route>
           <Route exact path="/honda/Scooter">
                <SecondMenu/>
                <Scooter/>
           </Route>
           <Route exact path="/honda/OffRoad">
                <SecondMenu/>
                <OffRoad/>
           </Route>
           <Route exact path="/honda/Trail">
           <SecondMenu/>
                {/* <ThirdMenu/> */}
                <Trail/>
           </Route>
           <Route exact path="/honda/city/pop">
                <ThirdMenu/>
                <Biz/>
           </Route>
           <Route exact path="/honda/city/biz">
                <ThirdMenu/>
                <Cgfan/>
           </Route>
           <Route exact path="/honda/city/cgfan">
                <ThirdMenu/>
                <CgTitam/>
           </Route>
           <Route exact path="/honda/city/cgtitan">
                <FourthMenu/>
                <Pop/>
           </Route>
           <Route exact path="/honda/city/cgtitan/painel">
                <FourthMenu/>
                <Painel/>
           </Route>
           <Route exact path="/honda/city/cgtitan/freios">
                <FourthMenu/>
                <Freios/>
           </Route>
           <Route exact path="/honda/city/cgtitan/tanque">
                <FourthMenu/>
                <Tanque/>
           </Route>
           <Route exact path="/honda/city/cgtitan/rodas">
                <FourthMenu/>
                <CgTitam2/>
           </Route>
           <Route exact path="/honda/city/cgtitan/carenagem">
                <FourthMenu/>
                <Carenagem/>
           </Route>
         </Switch>
       </Router>
    </div>
  );
}

export default App;
